  false,\n\t\"url\": null,\n\t\"notes\": \"The National Wildlife Refuge System (Refuge
  System) is engaging people with nature through education and outreach programs.
  Numerous educational tools have been designed, developed and implemented successfully.
  A great number of people still do not understand who the Refuge System is (the identity)
  and its purpose (why). This is particularly true for under-served communities. Strategic
  communications and marketing principles can form a framework to guide the development
  of targeted education and outreach tools. The intent of this project was to develop
  an engagement strategy that includes messages, tactics, and actions by using communication
  principles to help Bear River Migratory Bird Refuge become an effective member of
  the Latino community.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
